    "Small Mammal Survey of the Nulhegan Basin Division of the Silvio 0. Conte NFWR
    and the State of Vermont's West Mountain Wildlife Management Area, Essex County
    Vermont",nt"tracking_summary": {ntt"total": 1,ntt"recent": 0nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T23:05:58.445585",nt"name":
    "small-mammal-survey-of-the-nulhegan-basin-division-of-the-silvio-0-conte-nfwr-and-the-stat",nt"isopen":
    false,nt"url": null,nt"notes": "The objective of this study was to survey
    the small mammal diversity in the newly established Nulhegan Basin Division of the
    Silvio O. Conte National Fish and Wildlife Refuge (NFWR) and the West Mountain WMA.
    This survey was conducted by surveying wetland and upland sites that were characteristic
    of natural communities of this region including northern hardwood forests, red spruce-northern
    hardwood forests, black spruce swamps, dwarf shrub bogs, alluvial shrub bogs, and
    beaver meadows. In addition, specific habitats (hot spots), including swift-flowing
    streams, talus slopes and clear-cuts, associated with the occurrence of rare species
    of small mammals were surveyed. Bat activity and diversity was investigated by use
    of mist nets and acoustical monitoring.",nt"license_title": "License Not Specified",nt"extras":
